import React from "react";
import { useState } from "react";
import navCode from "../assets/file-code.svg";
import navWork from "../assets/briefcase.svg";
import navAbout from "../assets/file-earmark-person.svg";
import navContact from "../assets/phone.svg";

function NavModal({ navModal }) {
    const [active, setActive] = useState(null)

    if(navModal === true) {
        setActive(false)
    } else if(navModal === false) {
        setActive(true)
    }

  return (
    <div id="navModal">
      <div className={`navButtonCode ${active}`}>
        <img src={navCode} id="navCode" alt="Navigation Bar Button Code" />
      </div>
      <div className="navButtonWork">
        <img src={navWork} id="navWork" alt="Navigation Bar Button Work" />
      </div>
      <div className="navButtonAbout">
        <img src={navAbout} id="navAbout" alt="Navigation Bar Button About" />
      </div>
      <div className="navButtonContact">
        <img
          src={navContact}
          id="navContact"
          alt="Navigation Bar Button Contact"
        />
      </div>
    </div>
  );
}

export default NavModal;
